import React, { Component } from "react";
import {Col, Row, Container} from "../components/Grid";
import Nav from "../components/Nav";
import OutlineBtn from "../components/DeleteBtn/index.js";
import strawberry from "../images/strawberry.png";
import logo from "../images/logo_2.png";
import ("../pages/home.css");



class Home extends Component {
    render(){
        return(
            <Container>
                <Row >
                    <Col size="sm md lg xl">
                        <Nav>
                            <Col size="sm md lg xl">
                                <a className="navbar-brand" href="/">
                                    <img src={logo} alt="logo"/> 
                                </a>
                            </Col>
                            <Col size="sm md lg xl"></Col>
                            <Col size="offset-sm offset-md offset-lg xloffset-md">
                                <OutlineBtn style={{alignSelf:"left"}}>
                                    <i className="fas fa-sign-in-alt">Log-Out</i>
                                </OutlineBtn>
                            </Col>
                        </Nav>
                    </Col>
                </Row>
                <Row>
                    <div className="highest-rated">{/**formerly test  */}
                        <img src={strawberry} style={{marginLeft:150,opacity:"0.7", width:2000, marginTop:100, borderTop:"solid white 10px"}} alt="strawberries"/>
                    </div>
                </Row>
               
                            
                            <Row>
                    </Row>

                
                <Row>
                    <Col size="md"></Col>
                    <Col size="md"></Col>
                </Row>
            </Container>
        )
    }
}

export default Home;
